import React from 'react';


class Stable extends React.Component {
    gettingSoldiers = async () => {
        const api_url = await
        fetch('http://127.0.0.1:7001/soldier/all',{})
            .then(function(response) {
                return response.json();
            });
        const dataa = await api_url;
        console.log(dataa);
    }

    render() {
        return (
            <div>
                <button onClick={this.gettingSoldiers}>CLC</button>
            </div>
        )
    }
}

export default Stable;
